import React from 'react';

const podcast = () => {
  return (
    <div className='container'>
      <div className='  py-5 '>
        <h2 className='back'><b>Access top podcast directories and get your podcast listened to in all</b> </h2>
      </div>
      <h5  >Reach millions of listeners by having your podcast in Apple Podcasts, Spotify, Podcast Index, Google Podcasts, Amazon Music, Stitcher, iHeartRadio, Overcast, Castbox, and many more.</h5>
    </div>
  );
}

export default podcast;
